{
  "$schema": "./node_modules/@biomejs/biome/configuration_schema.json",
  "vcs": {
    "enabled": true,
    "clientKind": "git",
    "defaultBranch": "origin/develop",
    "useIgnoreFile": true
  },
  "files": {
    "ignore": ["dist/**", "public/**", "legacy/**"]
  },
  "formatter": {
    "enabled": true,
    "formatWithErrors": false,
    "indentStyle": "space",
    "indentWidth": 2,
    "lineEnding": "lf",
    "lineWidth": 150,
    "attributePosition": "auto",
    "ignore": []
  },
  "organizeImports": {
    "enabled": true
  },
  "linter": {
    "enabled": true,
    "rules": {
      "recommended": true,
      "correctness": {
        "noUnusedImports": {
          "level": "warn"
        },
        "useHookAtTopLevel": {
          "level": "error",
          "options": {}
        }
      },
      "performance": {
        "noBarrelFile": {
          "level": "warn"
        },
        "noReExportAll": {
          "level": "warn"
        }
      },
      "style": {
        "noDefaultExport": {
          "level": "warn"
        },
        "noNegationElse": {
          "level": "warn"
        },
        "useCollapsedElseIf": {
          "level": "warn"
        }
      },
      "suspicious": {
        "noConsoleLog": {
          "level": "error"
        },
        "noEmptyBlockStatements": {
          "level": "error"
        }
      }
    }
  },
  "overrides": [
    {
      "include": ["**/*.test.ts", "**/*.test.tsx"],
      "linter": {
        "rules": {
          "suspicious": {
            "noEmptyBlockStatements": {
              "level": "off"
            }
          }
        }
      }
    },
    {
      "include": ["packages/backend/**"],
      "linter": {
        "rules": {
          "style": {
            "useImportType": "off"
          },
          "correctness": {
            "useHookAtTopLevel": {
              "level": "off",
              "options": {}
            }
          }
        }
      }
    }
  ],
  "javascript": {
    "parser": {
      "unsafeParameterDecoratorsEnabled": true
    },
    "formatter": {
      "jsxQuoteStyle": "double",
      "quoteProperties": "asNeeded",
      "trailingCommas": "all",
      "semicolons": "always",
      "arrowParentheses": "always",
      "bracketSpacing": true,
      "bracketSameLine": false,
      "quoteStyle": "single",
      "attributePosition": "auto"
    }
  }
}

